    :root{
      --pink:#ffd6e7;

    *{box-sizing:border-box}
    body{
      margin:0;
      font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Apple SD Gothic Neo","Noto Sans KR", "Helvetica Neue", Arial, sans-serif;

      padding:32px 20px 64px;

      box-shadow:0 10px 25px rgba(255, 143, 184, .35);
      padding:28px 20px;
      border:4px solid #ffe2ef;

      font-weight:800;

      color:#e3568c;

      width:160px;height:160px;object-fit:cover;border-radius:24px;border:5px solid #fff;box-shadow:0 6px 16px rgba(0,0,0,.06)
    }
    .btns{display:flex;flex-direction:column; gap:12px; margin:22px 0}
    .btn{
      display:flex; align-items:center; justify-content:center;
      gap:10px;
      text-decoration:none;
      padding:14px 16px;
      border-radius:14px;
      background:linear-gradient(180deg,#ffb6d2,#ff8fb8);
      color:#fff; font-weight:700; font-size:16px;
      box-shadow:0 8px 18px rgba(227, 86, 140,.35);
      border:2px solid #ffd1e1;
    }
    .btn.secondary{
      background:#fff; color:#e3568c; border:2px dashed #ffc0d6;
      box-shadow:none;
    }
    .grid{display:grid;grid-template-columns:repeat(3,1fr);gap:12px;margin-top:18px}
    .chip{background:#fff;border:2px solid #ffd8e8;border-radius:999px;padding:8px 12px;font-weight:700;color:#e3568c}
    footer{margin-top:26px;font-size:12px;opacity:.7}
    .pearls{margin-top:10px;display:flex;justify-content:center;gap:8px}
    .pearl{width:12px;height:12px;border-radius:50%;background:radial-gradient(circle at 30% 30%, #fff, #e7dce2)}
